import { Button } from '@material-ui/core';
import './App.css';
import Grid from '@material-ui/core/Grid';
import Container from '@material-ui/core/Container';
import { styled } from '@mui/material/styles';
import heroImage from '../src/hero.svg'
import Box from '@material-ui/core/Box';
import me from '../src/me.svg';
function Process() {
  return (
    <Container maxWidth="xl" style={{ background: '#154D43', position: "relative", height: "800px"}}>
     <Grid container spacing = {10} alignContent="flex-start"  alignItems="center" justifyContent="center"> 
        {/* <h1>Hi</h1> */}
        <Grid item xs={5}>
          <Box p={0}>
            <img src = {heroImage} height = "600px" width = "600px"/>
          </Box>
        </Grid>
        <Grid item xs={5}>
          <Box bgcolor="secondary.light" p={0}>
            <h1 style={{fontFamily: 'yeseva one', fontSize: 24}}>Who Am I?</h1>
          </Box>
          <Grid item>
          <Box bgcolor="secondary.light" p={0}>
            <p style={{fontFamily: 'josefin sans', fontSize: 25, color: 'white'}}> A software developer and a top rated startup business consultant specializing in startup development. With experience in consulting, venture capital, and technology, I am constantly gaining more exposure to business growth and the intersection of technology and business.  </p>
          </Box>
          <Box bgcolor="secondary.light" p={0}>
            <p style={{fontFamily: 'josefin sans', fontSize: 25, color: 'white'}}> Together embark on a journey where your ventureâ€™s potential knows no bounds. </p>
          </Box>
        </Grid>
        </Grid>
        </Grid>
    </Container>
  )
}

export default Process;
